description:
Spicing Up The Marriage
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Synopsis: When work and responsibility begin to pull a young couple apart, good old fashion love letters serve as the perfect remedy for their dry spell. After dedicating one day a week to satisfying one another, a husband and wife discover that sometimes the hottest sex is the kind you actually planned for. An inhibited woman transforms into an insatiable sex goddess when she allows her husband to photograph erotic nudes of her. Working out becomes the ultimate foreplay after a couple enjoys a steamy encounter at the gym.

Cast: Jillian Janson, Natalia Starr, Keira Nicole, Jade Nile, Logan Pierce, Richie Calhoun, Chad White, Ryan Mclane, Scott Taylor ProducerJacky St. James,Director

